import './TitlePage.scss';

function TitlePage() {
    return (
      <div className="titlePage">
        <h1 className="titlePage__title">
            BIM для производителя Библиотеки семейств и каталогов
        </h1>
      </div>
    );
  }

  export default TitlePage;
